import React, { useState, useRef, useEffect } from 'react';

const GIF_DATA = ``;

const VideoPlayer = () => {
  const [isPlaying, setIsPlaying] = useState(true);
  const [currentTime, setCurrentTime] = useState(0);
  const [duration] = useState(45);
  const [isHovering, setIsHovering] = useState(false);
  const [previousPosition, setPreviousPosition] = useState(null);
  const [showPreviousMarker, setShowPreviousMarker] = useState(false);
  const progressBarRef = useRef(null);
  const animationFrameRef = useRef(null);
  const startTimeRef = useRef(Date.now());
  const markerTimeoutRef = useRef(null);

  const formatTime = (seconds) => {
    const mins = Math.floor(seconds / 60);
    const secs = Math.floor(seconds % 60);
    return `-${String(mins).padStart(2, '0')}:${String(secs).padStart(2, '0')}`;
  };

  useEffect(() => {
    const animate = () => {
      if (isPlaying) {
        const elapsed = (Date.now() - startTimeRef.current) / 1000;
        const newTime = elapsed % duration;
        setCurrentTime(newTime);
      }
      animationFrameRef.current = requestAnimationFrame(animate);
    };
    
    animationFrameRef.current = requestAnimationFrame(animate);

    return () => {
      if (animationFrameRef.current) {
        cancelAnimationFrame(animationFrameRef.current);
      }
      if (markerTimeoutRef.current) {
        clearTimeout(markerTimeoutRef.current);
      }
    };
  }, [isPlaying, duration]);

  const startMarkerTimeout = () => {
    if (markerTimeoutRef.current) {
      clearTimeout(markerTimeoutRef.current);
    }
    markerTimeoutRef.current = setTimeout(() => {
      setPreviousPosition(null);
      setShowPreviousMarker(false);
    }, 30000);
  };

  const togglePlay = () => {
    if (isPlaying) {
      setIsPlaying(false);
    } else {
      startTimeRef.current = Date.now() - (currentTime * 1000);
      setIsPlaying(true);
    }
  };

  const handleProgressClick = (e) => {
    if (progressBarRef.current) {
      e.stopPropagation();
      const rect = progressBarRef.current.getBoundingClientRect();
      const clickX = e.clientX - rect.left;
      const percentage = Math.max(0, Math.min(1, clickX / rect.width));
      const newTime = percentage * duration;
      
      if (Math.abs(newTime - currentTime) > 0.5) {
        setPreviousPosition(currentTime);
        setShowPreviousMarker(false);
        startMarkerTimeout();
      }
      
      setCurrentTime(newTime);
      startTimeRef.current = Date.now() - (newTime * 1000);
    }
  };

  const skipTime = (seconds) => {
    setPreviousPosition(currentTime);
    setShowPreviousMarker(false);
    const newTime = Math.max(0, Math.min(duration, currentTime + seconds));
    setCurrentTime(newTime);
    startTimeRef.current = Date.now() - (newTime * 1000);
    startMarkerTimeout();
  };

  const handleMouseEnter = () => {
    setIsHovering(true);
    if (previousPosition !== null) {
      setShowPreviousMarker(true);
    }
  };

  const handleMouseLeave = () => {
    setIsHovering(false);
  };

  const progressPercentage = (currentTime / duration) * 100;
  const previousPositionPercentage = previousPosition ? (previousPosition / duration) * 100 : null;
  const remainingTime = duration - currentTime;

  return (
    <div className="flex items-center justify-center min-h-screen bg-black">
      <style>{`
        @import url('https://fonts.googleapis.com/css2?family=Geist:wght@300;400;500&display=swap');
        
        * {
          font-family: 'Geist', -apple-system, BlinkMacSystemFont, sans-serif;
        }

        .progress-bar {
          transition: height 0.15s ease-out;
        }

        .progress-bar-dashed {
          background-image: repeating-linear-gradient(
            90deg,
            rgba(255, 255, 255, 0.9) 0px,
            rgba(255, 255, 255, 0.9) 1px,
            transparent 1px,
            transparent 2.5px
          );
          background-size: 2.5px 100%;
        }

        .control-button {
          font-size: 10px;
          letter-spacing: 0.05em;
          font-weight: 400;
        }
      `}</style>

      <div className="relative" style={{width: '360px', height: '232px', background: '#000'}}>
        {/* Actual GIF */}
        <img
          src={`data:image/gif;base64,${GIF_DATA}`}
          alt="Scene"
          className="absolute inset-0 w-full h-full object-cover"
          style={{ pointerEvents: 'none' }}
        />

        {/* Bottom gradient overlay */}
        <div 
          className="absolute bottom-0 left-0 right-0 pointer-events-none"
          style={{
            height: '120px',
            background: 'linear-gradient(to top, rgba(0,0,0,0.6) 0%, transparent 100%)'
          }}
        />

        {/* Click overlay for play/pause */}
        <div 
          className="absolute inset-0 cursor-pointer"
          onClick={togglePlay}
          style={{ zIndex: 1 }}
        />

        {/* Controls */}
        <div className="absolute bottom-0 left-0 right-0" style={{ padding: '14px 16px 12px 16px', zIndex: 10 }}>
          {/* Time */}
          <div 
            className="text-white mb-2 pointer-events-none" 
            style={{ 
              fontSize: '28px',
              fontWeight: '300',
              letterSpacing: '-0.02em',
              lineHeight: '1'
            }}
          >
            {formatTime(remainingTime)}
          </div>

          {/* Progress bar */}
          <div
            ref={progressBarRef}
            className="relative mb-3 cursor-pointer pointer-events-auto"
            onMouseEnter={handleMouseEnter}
            onMouseLeave={handleMouseLeave}
            onClick={handleProgressClick}
            style={{ paddingTop: '8px', paddingBottom: '8px' }}
          >
            {/* Background track */}
            <div 
              className={`w-full bg-white/20 progress-bar`}
              style={{
                height: isHovering ? '16px' : '2px',
                position: 'relative',
                borderRadius: isHovering ? '0px' : '9999px'
              }}
            >
              {/* Current progress */}
              <div
                className={`absolute left-0 top-0 ${
                  isHovering ? 'progress-bar-dashed' : 'bg-white'
                }`}
                style={{ 
                  width: `${progressPercentage}%`,
                  height: '100%',
                  borderRadius: isHovering ? '0px' : '9999px',
                  transition: 'none'
                }}
              />

              {/* Previous position marker (yellow dash) - ONLY when hovering AND after a seek */}
              {isHovering && showPreviousMarker && previousPositionPercentage !== null && (
                <div
                  className="absolute bg-yellow-400"
                  style={{
                    left: `${previousPositionPercentage}%`,
                    top: '0',
                    width: '1px',
                    height: '100%',
                    transform: 'translateX(-50%)'
                  }}
                />
              )}
            </div>
          </div>

          {/* Buttons */}
          <div className="flex items-center justify-between text-white/70 pointer-events-auto">
            <button
              onClick={(e) => {
                e.stopPropagation();
                skipTime(-10);
              }}
              className="flex items-center gap-1.5 hover:text-white transition-colors control-button uppercase"
            >
              <svg width="12" height="12" viewBox="0 0 24 24" fill="none" stroke="currentColor" strokeWidth="2" strokeLinecap="round" strokeLinejoin="round">
                <polygon points="11 19 2 12 11 5 11 19"></polygon>
                <polygon points="22 19 13 12 22 5 22 19"></polygon>
              </svg>
              <span>Prev</span>
            </button>

            <button
              onClick={(e) => {
                e.stopPropagation();
                skipTime(10);
              }}
              className="flex items-center gap-1.5 hover:text-white transition-colors control-button uppercase"
            >
              <span>Next</span>
              <svg width="12" height="12" viewBox="0 0 24 24" fill="none" stroke="currentColor" strokeWidth="2" strokeLinecap="round" strokeLinejoin="round">
                <polygon points="13 19 22 12 13 5 13 19"></polygon>
                <polygon points="2 19 11 12 2 5 2 19"></polygon>
              </svg>
            </button>
          </div>
        </div>
      </div>
    </div>
  );
};

export default VideoPlayer;
